import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookF, faInstagram, faTwitter, faWhatsapp } from '@fortawesome/free-brands-svg-icons';
import './navbar.scss';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo-container">
        <img src="/images/logo.jpg" alt="Bella Cucina Logo" className="logo" />
        <span className="logo-text">Bella Cucina</span>
      </div>
      <ul className="menu">
        <li><Link to="/" className="nav-link">Home</Link></li>
        <li><Link to="/menu" className="nav-link">Menu</Link></li>
        <li><Link to="/about-us" className="nav-link">About Us</Link></li>
        <li><Link to="/location" className="nav-link">Location</Link></li>
      </ul>
      <div className="social-media">
        <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="social-icon">
          <FontAwesomeIcon icon={faFacebookF} />
        </a>
        <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="social-icon">
          <FontAwesomeIcon icon={faInstagram} />
        </a>
        <a href="https://twitter.com" target="_blank" rel="noopener noreferrer" className="social-icon">
          <FontAwesomeIcon icon={faTwitter} />
        </a>
        <a href="https://wa.me/1234567890" target="_blank" rel="noopener noreferrer" className="social-icon">
          <FontAwesomeIcon icon={faWhatsapp} />
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
